import { Link } from "react-router-dom";

export default function EventsPage() {
  const DUMMY_EVENTS = [
    { id: "e1", title: "event-1" },
    { id: "e2", title: "event-2" },
    { id: "e3", title: "event-3" },
  ];

  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((e) => (
          <li key={e.id}>
            <Link to={e.id}> {e.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
